window.bookSummaryJSON = "Acclaimed author L.M. Montgomery continues the story of <i>Anne of Green Gables</i> and <i>Anne of Avonlea</i> in <i>Anne's House of Dreams</i>. Anne and Gilbert move to Four Winds Harbor to start their new life together. The young married couple buys their dream house, encounters new adventures, and makes new friends. Barbara Caruso's entertaining narration brings listeners to Four Winds and makes them feel a part of this shoreline community."; 
